export default function saveUser (user) {
  console.log('save this user', user);
  return fetch(`${process.env.REACT_APP_API_DEV_HOST || ''}/api/user`, {
      method: 'POST',
      body: JSON.stringify(user)
    })
    .then(r => r.json());
};
